import { useState } from "react";
import reactLogo from "./assets/react.svg";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/navbar.js";
import { Outlet } from "react-router-dom";
import Footer from "./components/footer.js";
import "./components/App.css";
import { StrictMode } from "react";
import { createRoot } from "react-dom/client";
// import Blog from "./blog.jsx";
// import Contact from "./contactus.jsx";
// import Gallery from "./gallery.jsx";
// import Index from "./index.jsx";
// import Sponsors from "./sponsors.jsx";
// import ErrorElement from "./ErrorElement.jsx";

function App() {
    return (
        // <div>
        //     <Navbar />
        //     <main>
        //         <Outlet />
        //         <p>
        //             Welcome to our page! We're the Robosub team for the University of California, San Diego. We're a diverse family, with interests in computer science, engineering, and more -- including a passion to create an Autonomous Underwater Vehicle (AUV). Our members seek to strengthen their skills in computer vision, engineering fundamentals, and most importantly, teamwork!
        //         </p>
        //     </main>
        //     <Footer />
        // </div>

        <Router>
            <Routes>
                <Route path ="../components/main" element={<Main />}/>
                <Route path ="../about/alumni" element={<Alumni />}/>
                <Route path ="../about/meettheteam" element={<MeetTheTeam />}/>
                <Route path="../auv/overview" element={<Overview />}/>
                <Route path="../auv/electrical" element={<Electrical />}/>
                <Route path="../auv/mechanical" element={<Mechanical />}/>
                <Route path="../auv/software" element={<Software />}/>
                <Route path="../components/blog" element={<Blog />}/>
                <Route path="../components/gallery" element={<Gallery />}/>
                <Route path="../components/contactus" element={<ContactUs />}/>
                <Route path="../components/sponsors" element={<Sponsors />}/>
            </Routes>
        </Router>
    );
}

export default App;
